import React from 'react';

export type IPokemon = {
    imageURL: String,
    name: String,
}

class Pokemon extends React.Component<IPokemon> {
    constructor(props: IPokemon) {
        super(props);

        this.state = {}
    }
    render() {
        return (
            <div>
                <p>Name: {this.props.pokemon.name}</p>
                <img src="https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/3.png" alt="Venusaur"></img>
            </div>
        )
    }
}

export default Pokemon
